import React, { Component } from "react";
import images from "./images.json";
import "./App.css";
import Jumbotron from "./components/jumbotron/index";

class App extends Component {
  state = {
    images: images,
    score: 0
  };

  render() {
    return (
      <div>
        <Jumbotron />
        <ScoreHeader score={this.state.score} />
      </div>
    );
  }
}

export default App;
